import React from 'react'
import NavBar from '../navbar/NavBar'
import Infobox from '../infobox/InfoboxContainer'

class HomeContainer extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            plans: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:5000/plans/all")
            .then(results => results.json())
            .then(plans => {
                console.log(plans)
                this.setState({
                    plans: plans
                })
            })
            .catch(err => console.log(err))
    }

    getAllPlans() {
        let list = []
        console.log(this.state.plans.length)
        for (let i = 0; i < this.state.plans.length; i++) {
            console.log("blah")
            list.push(<div className="col-md-8"><Infobox type={this.state.plans[i].type.name+".jpg"}/></div>)
        }
        return list
    }

    render() {
        return (
            <>
            <NavBar />
            <div className="container">
                <div className="row">
                    <div className="col-md-8">{this.getAllPlans()}</div>
                </div>
            </div>
            </>
        )
    }
}

export default HomeContainer
